import Link from "next/link";

const linkStyle = {
  marginRight: 15,
  color: "salmon"
};

function Header() {
  return (
    <div>
      <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href="/about">
        <a style={linkStyle}>Pets</a>
      </Link>
    </div>
  );
}

export default Header;
